import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";

const animateFrom = { opacity: 0, y: -40 };
const animateTo = { opacity: 1, y: 0 };

const MobileNavLinks = (props) => {
  return (
    <motion.ul
      initial={animateFrom}
      animate={animateTo}
      transition={{ delay: 0.05 }}
      className="mobile-ul-links-container"
    >
      <motion.li
        initial={animateFrom}
        animate={animateTo}
        transition={{ delay: 0.2 }}
        className="nav-links"
      >
        <Link
          className="nav-links"
          to="/home/projects"
          alt="Link to projects page"
        >
          Portfolio
        </Link>
      </motion.li>

      <motion.li
        initial={animateFrom}
        animate={animateTo}
        transition={{ delay: 0.3 }}
        className="nav-links"
      >
        <Link
          className="nav-links"
          to="/home/webapps"
          alt="Link to Web Apps page"
        >
          Web-Apps
        </Link>
      </motion.li>

      <motion.li
        initial={animateFrom}
        animate={animateTo}
        transition={{ delay: 0.4 }}
        className="nav-links"
      >
        <Link
          className="nav-links"
          to="/home/contact"
          alt="Link to contact page"
        >
          Contact
        </Link>
      </motion.li>

      <motion.li
        initial={animateFrom}
        animate={animateTo}
        transition={{ delay: 0.5 }}
        className="nav-links"
      >
        <Link
          className="nav-links"
          id="nav-home-link"
          to="/home/"
          alt="Link to home/about page"
        >
          Home/About
        </Link>
      </motion.li>
    </motion.ul>
  );
};

export default MobileNavLinks;
